func MassInsert_MetricLog(rows []MetricLog, db XODB) error {
	if len(rows) == 0 {
		return errors.New("rows slice should not be empty - inserted nothing")
	}
	var err error
	ln := len(rows)
	s := "(?,?,?,?,?,?)," //`(?, ?, ?, ?),`
	insVals_ := strings.Repeat(s, ln)
	insVals := insVals_[0 : len(insVals_)-1]
	// sql query
	sqlstr := "INSERT INTO sun_log.metric_log (" +
		"InstanceId, StartFrom, EndTo, StartTime, Duration, MetericsJson" +
		") VALUES " + insVals

	// run query
	vals := make([]interface{}, 0, ln*5) //5 fields

	for _, row := range rows {
		// vals = append(vals,row.UserId)
		vals = append(vals, row.InstanceId)
		vals = append(vals, row.StartFrom)
		vals = append(vals, row.EndTo)
		vals = append(vals, row.StartTime)
		vals = append(vals, row.Duration)
		vals = append(vals, row.MetericsJson)

	}

	if LogTableSqlReq.MetricLog {
		XOLog(sqlstr, " MassInsert len = ", ln, vals)
	}
	_, err = db.Exec(sqlstr, vals...)
	if err != nil {
		if LogTableSqlReq.MetricLog {
			XOLogErr(err)
		}
		return err
	}

	return nil
}

